script: |
  super -f text -I q7050.spq | sort > q7050.out

inputs:
  - name: q7050.spq
    data: |
      SELECT DISTINCT - 90 * + 40 - col1 * ( - col2 ) / - cor0.col1 AS col2 FROM tab0 (FORMAT parquet) cor0;
  - name: tab0

outputs:
  - name: q7050.out
    data: |
      -3601
      -3633
      -3682
